import React, { Component } from 'react';
import {FirebaseDatabaseMutation}
                         from "@react-firebase/database";

import './set-sensetive.css';



const path = "hits";
export default class SetSensetive extends Component {

  state = {
    person: null
  };

  render() {

    return (
      <div>
                  <FirebaseDatabaseMutation type="push" path={path}>
             {({ runMutation }) => {
                return (
                  <div>
                  <input type = "number" size="17" className="butnSens" onChange ={this.setPath}/>
                    <button
                      data-testid="test-push"
                      onClick={async () => {
                        const { key } = await runMutation({ PARAM: this.state.setSensetive });
                        this.setState({ pushedKey: key });
                        console.log("key"+key);
                      }}
                    > setSenSyvity
                    </button>
                  </div>
                );
              }}
          </FirebaseDatabaseMutation>
      </div>
    )
  }
}
